/**初始化react,所有组件在这里集合 */

import React, { Component } from 'react';
import './index.pcss';
import '../../common_img/font_icon/iconfont.css';
//PC版
import Header from './header';
import Help from './help';
import MapTipBox from './mapTip';
import MainMenu from './menu';
import Loading from './load';
import OpenIframe from './iframe';
import IntroductionSimple from './Introduction';
import ViewPicture from './viewPicture';
import Thumbnails from './thumbnails';
import HotPhotoWall from './hotWall';
import PanoMap from './map';
import MarkerInterface from './markerInterface';
import ReviewInput from './review';
import VideoBox from './videoBox';
import VideoPeople from './videoBox/VideoPeople';
import OtherLinks from './links';
import RoamingBox from './roaming';
import SettingBox from './setting';
//手机版
import PBottom from '../Phone/bottom';
import PHotPhotoWall from '../Phone/hotWall';
import POpenIframe from '../Phone/iframe';
import PIntroductionSimple from '../Phone/Introduction';
import PLoading from '../Phone/load';
import PPanoMap from '../Phone/map';
import PMarkerInterface from '../Phone/markerInterface';
import PRight from '../Phone/right';
import PSettingBox from '../Phone/setting';
import PThumbnails from '../Phone/thumbnails';
import PVideoBox from '../Phone/videoBox';

class Index extends Component {
	render() {
		return /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) ? (//手机版UI界面
			<div className="reactApp">
				<PBottom />
				{/* <PHotPhotoWall />
				<POpenIframe />
				<PIntroductionSimple />
				<PLoading />
				<PPanoMap />
				<PMarkerInterface />
				<PRight />
				<PSettingBox />
				<PThumbnails />
				<PVideoBox /> */}
			</div>
		) : (//PC版UI界面
			<div className="reactApp">
				<Header />
				<MainMenu />
				<Help />
				<MapTipBox />
				<Loading />
				<OpenIframe />
				<IntroductionSimple />
				<ViewPicture />
				<Thumbnails />
				<HotPhotoWall />
				<PanoMap />
				<MarkerInterface />
				<ReviewInput />
				<VideoBox />
				<VideoPeople />
				<OtherLinks />
				<RoamingBox />
				<SettingBox />
			</div>
		);
	}
}

export default Index;
